import { makeStyles } from "@mui/styles";
import React from "react";
import  Footer from "/home/vishaly/Blinkist/my-blinlist/src/components/organisms/Footer/index";
import { HeaderComponent } from "/home/vishaly/Blinkist/my-blinlist/src/components/organisms/Header/index";

export interface MyLibraryProps {

    body: React.ReactNode;
}

let useStyles = makeStyles({
    test: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
    }
})

export const MyLibrary = (props: MyLibraryProps) => {
    let {body} = props
    let styles = useStyles()
    return (
        <div style={{display:'flex', flexDirection:'column'}}>

            <HeaderComponent/>
            <div style={{width:"100%", display: 'flex', justifyContent:'center'}}>
            {body}
            </div>
            <Footer/>
        </div>
    )
}
